//Global functions for smooth scrolling
function trainersSmoothScrollExclusive(anchorName){
    $('html, body').animate({ scrollTop: $(anchorName).offset().top -1});
}

function smoothScroll(anchorName)
{
    $('html, body').stop();
    $('html, body').animate({ scrollTop: $(anchorName).offset().top}, function(){
        history.pushState('', document.title, window.location.pathname);
    });
}
function closePanelthenScroll(anchorName){
    $('.in').collapse('hide');
    setTimeout(function(){
        $('html, body').animate({ scrollTop: $(anchorName).offset().top}, function(){
            history.pushState('', document.title, window.location.pathname);
        });
    },500);
}

